import { useState, useEffect } from "react";

function User() {
  const [user, setUser] = useState();
  const loadUser = async () => {
    const res = await fetch("http://localhost:3001/userdb");
    setUser(res.json());
  };

  useEffect(() => {
    loadUser();
  }, []);

  return <></>;
}

export default User;
